import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M11.5 5.5a1.5 1.5 0 012.47-1.14l7.41 6.3c.82.7.82 1.97 0 2.67l-7.4 6.3a1.5 1.5 0 01-2.48-1.13v-4l-6.03 5.14A1.5 1.5 0 013 18.5v-13a1.5 1.5 0 012.47-1.14L11.5 9.5V5.5zm0 5.96l-7-5.96v13l7-5.96v-1.08zm8.91.35L13 5.5V18.5l7.41-6.31a.25.25 0 000-.38z", fill: primaryFill }));
};
const FastForward24Regular = wrapIcon(rawSvg({}), 'FastForward24Regular');
export default FastForward24Regular;
